//player.vimeo.com/video/961922",thumb:"https://vumbnail.com/00961922.jpg",thumbTitle:"Highland Park"})]}},{title:"AccountChek",urlSlug:"account-chek",featuredImage:[1,1],beginDescription:"<p>At <strong>FormFree</strong> I was tasked with redesigning their user-facing <em>AccountChek</em> application. The purpose of <em>AccountChek</em> is to allow a potential home buyer to more easily share their banking details with a mortgage lender than is possible with traditional methods. <em>AccountChek</em> was written in an older version of Angular and had a very plain design. </p>",endDescription:"<p> I created a more modern design that featured background colors and shapes as an enlarged version of the <em>AccountChek</em> logo. The design process was a long collaboration between me and the stakeholders regarding the appearance, the suitability for present needs, and the capacity to address future components that were in the planning stages. </p><p> With this new design in mind, I rebuilt the application in the latest version of Angular available at that time. I was intentional about ensuring accessibility for users with poor vision, colorblindness, requiring screen readers, or limited to keyboard-only access. I placed strong emphasis on test-driven-design by writing over 540+ unit tests that passed on multiple web browsers checked with BrowserStack. This application has very strict code quality controls enforced by TypeScript build options and code linting. </p><p> In a few months, with only light guidance from others, I successfully redesigned and rebuilt the <em>AccountChek</em> application for <strong>FormFree</strong>.</p><p><strong>Tech Stack</strong>: TypeScript 4, Angular 8, SCSS, Bootstrap 4, ASP.NET MVC, Jasmine</p>",galleries:[{title:"Previous <em>AccountChek</em> Design - Desktop",id:"prevAccountCheckDesktop",images:[new m({thumb:"assets/design/FormFree/Previous Design/previous-desktop-1-login_Thumb.png",src:"assets/design/FormFree/Previous Design/previous-des